One of my favorite towns to shop in is Winchester, MA! 😃 It’s only a quick ride from my home to access 5 fabulous shops…if you are not local to the area, you can check them out online…

@thehiveofwinch, Something for everyone, whether you prefer sexy or conservative. Nice range of price points. Fun atmosphere!

@revel_winchester, Elegant attire for work or play, with lots of gift options for the gal who has everything!  A luxurious men’s line as well, which is not easy to find these days…

@soleamour, Shoes are fabulous, and the clothing brands are unique! Not to mention that they carry @frenchkandejewelry! 

@home_winchester, Such a fun shop for unique home decor and gift items. You can’t go in and not buy something!  Just got a fab Yankee Swap gift here…

@revolveboutiques, Last but not least, my fave consignment shop! The merchandise is always changing, and is priced fairly. Obsessed. 

Pics from Winchester Christmas shopping last Saturday - major success in ALL 5 shops! 😜😜😜

The outfit: mixing sweet with edgy! An old sweater by @annamolinariofficial, @chloe boots. Raincoat by @janepostcoats. ❤️

Happy Saturday all! 🎄

Work hard. Play hard. Enjoy every day. 

