Nantucket post #3! ⚓️

So many fabulous restaurants! 

Our favorite for lunch OR dinner is hands down @crunantucket, on the marina and hopping with energy!  We always sat at the bar and we never made reservations…great lobster rolls, creative cocktails, and people watching to keep you constantly entertained! 😃

Also enjoyed: 
@galleybeach ($$$$)
@brotherhoodnantucket (pub food)
@clubcar (go for the 🎶)
@slip14 (casual, fun, yummy) 
@sandbarjetties (fun lunch)

Our evening style: 
The striped outfit is not a dress, it is a top and skirt, which makes it super versatile! It is a metallic gold and navy knit, by @michaelkors…also take note that I ignore the ‘no heels’ in Nantucket rule - since we had a car, not a big deal…😜 

My second outfit was a fun combo of laidback and sexy: boyfriend-cut pants, a lace bustier by @aliceandolivia, and black patent block heels…

Hubs also embraced stripes with a linen jacket @toddsnyderny and  cotton shirt by @cremieux.fr…

Happy Wednesday all! 😎

Work hard. Play hard. Enjoy every day. 

