What could be better than a Hollywood-themed fashion event? ⭐️⭐️⭐️⭐️⭐️⭐️

My daughter (in black dress) and I recently attended The Runway Ball at Boston’s Park Plaza Hotel…it was non-stop fun with photo opportunities, cotton candy, themed cocktails, and live music! 🎶 🎶🎶🎶

There were so many gorgeous gals in glamorous outfits, but the Boston matriarch of fashion, Yolanda Cellucci (center), was most impressive of all - can you believe that she is 89! 😮😮😮 Such an inspiration! 

Thanks to the major efforts of Amanda, @waveandwoven and Matt @bostonmanmag, the fashion show did not disappoint - models and designs were all so fabulous it felt like we were in NYC! 

All of this on a Sunday night, so it wasn’t easy getting out of bed on Monday morning, but without a doubt, absolutely worth it! 😜

